export const getBlogLists = categoryName => {
  const URL = "http://localhost:9000/blogs/";
  const category = categoryName || "";

  return dispatch => {
    fetch("http://localhost:9000/blogs/" + category)
      .then(res => res.json())
      .then(result => {
        dispatch({
          type: "BLOG_LISTS",
          blogs: result.data
        });
      })
      .then(error => {
        dispatch({
          type: "FETCH_ERROR",
          error
        });
      });
  };
};
